import Schedule from './Schedule';
import './Home.css';
import Memories from '../Memories/Memories';
import Nametype from './Nametype';

function Home() {
    return (
        <div className='home'>
            <div className='content'>
                <div>
                    <div>
                        <Nametype />
                    </div>

                    <div className='video'>
                        <video
                            src="video.mp4"
                            controls
                            muted
                            autoPlay={"autoplay"}
                            preLoad="auto"
                            loop
                        // width="500" height="280"
                        > something</video>
                    </div>
                </div>
            </div>
            <div className='bg'>
                <Memories />
                <div className='schedule'>
                    <Schedule />
                </div>
            </div>
        </div>
    )
}
export default Home
